export const AJOUTER = "AJOUTER";
export const SUPPRIMER = "RETIRER";
export const ENREGISTRER = "ENREGISTRER";

export const ajouterTransaction = (montant) => ({
    type: AJOUTER,
    payload: montant,
  });
  
  export const retirerTransaction = (montant) => ({
    type: RETIRER,
    payload: montant,
  });
  
  export const enregistrerTransactions = () => ({
    type: ENREGISTRER,
  });
